import React from 'react'
import { useSWRPaginate } from 'swr-paginate';
import useSWR from 'swr';
import axios from 'axios';



const search = () => {

    const fetcher = async (url) => {
  const response = await axios.get(url);
  return response.data;
};

const buildUrl = (page) => `http://localhost:5000/igd/pasien?search=&page=${page}&limit=10`;
const { pages, isLoadingMore, loadMore } = useSWRPaginate(buildUrl, fetcher);

  return (
    <div>
    {pages.map((page, index) => (
      <div key={index}>
        {page.map((item) => (
          <div key={item.id}>
            <p>{item.nama_lengkap}</p>
            
          </div>
        ))}
      </div>
    ))}
    <button onClick={() => loadMore()}>Load more</button>
    {isLoadingMore && <p>Loading...</p>}
  </div>
  )
}

export default search
